    def load_saved_gesture_type(self):
            payload = Payload()

            # Check if it's the first time running
            if payload.is_first_time_gesture_type:
                    # For the first time, set Auto_Mode_Button_2 as checked
                    self.Auto_Mode_Button_2.setChecked(True)
                    print("*************** First time: Switching to Static Mode (Auto Mode)")

                    # Set flag to False after the first run
                    payload.is_first_time_gesture_type = False
            else:
                    # Fetch the saved mode value
                    current_gesture_type = payload.get_gesture_type()
                    print("**********************Current Static/Dynamic Mode: ", current_gesture_type)

                    # Set the radio button state based on the saved mode
                    if current_gesture_type == 1:
                            self.Auto_Mode_Button_2.setChecked(True)
                            self.Manual_Mode_Button_2.setChecked(False)
                            print("*************** Switching to Static Mode ")
                    elif current_gesture_type == 2:
                            self.Manual_Mode_Button_2.setChecked(True)
                            self.Auto_Mode_Button_2.setChecked(False)
                            print("******************* Switching to Dynamic Mode")

    def load_saved_mode(self):
            payload = Payload()

            # Check if it's the first time running
            if payload.is_first_time_mode:
                    # For the first time, set Auto_Mode_Button_2 as checked
                    self.Auto_Mode_Button.setChecked(True)
                    print("*************** First time: Switching to Auto Mode")

                    # Set flag to False after the first run
                    payload.is_first_time_mode = False
            else:
                    # Fetch the saved mode value
                    current_mode = payload.get_mode()
                    print("**********************Current Auto/manual Mode: ", current_mode)

                    # Set the radio button state based on the saved mode
                    if current_mode == 2:
                            self.Auto_Mode_Button.setChecked(True)
                            self.Manual_Mode_Button.setChecked(False)
                            print("*************** Switching to auto mode")
                    elif current_mode == 1:
                            self.Manual_Mode_Button.setChecked(True)
                            self.Auto_Mode_Button.setChecked(False)
                            print("******************* Switching to manual mode ")



